% This file is just for triggering the file "Falling_SRA_V2_Simplified".
% The reason for setting up the file is that some of the calculations in
% the original file can take such a long time, and repeated calculations
% are definitely waste of time.
% Since all the matrices have been examined for at least four times, there
% should not be any problems, all the useful data has been stored in
% v2s.mat file.

% 2023.01.10
clc; clear all;
load('v2s.mat');
% You can copy the expression into dq(3) and dq(4) respectively, and
% temporarily I haven't figured out an efficient way to directly use the
% symbolic expressions.
% eom_intm(1)
% eom_intm(2)

% initial condition settings
q0=[-30/180*pi;30/180*pi;0;0];
tspan=linspace(0,10,1000);
options=odeset('RelTol',1e-4,'AbsTol',1e-4);
% [t,q]=ode23(@(t,q) odefun(t,q,eom_intm),tspan,q0);
[t,q]=ode15s(@odefun,tspan,q0,options);

% plot process
subplot(1,2,1);
plot(t,q(:,1),'linewidth',1);
grid on; hold on;
plot(t,q(:,2),'linewidth',1);
title('Angle');
xlabel('Time (s)');
ylabel(['\theta_{1}',' & ','\theta_2 (rad)']);
legend('\theta_{1}','\theta_2','location','northeastoutside');
subplot(1,2,2);
plot(t,q(:,3),'linewidth',1);
hold on; grid on;
plot(t,q(:,4),'linewidth',1);
title('Angular Velocity');
% xlim([0,0.2]);
xlabel('Time (s)');
ylabel(['$$\dot{\theta_1}$$',' and ','$$\dot{\theta_2}$$',' (rad/s)'],'interpreter','latex');
legend({'$\dot{\theta_1}$','$\dot{\theta_2}$'},'interpreter','latex','location','northeastoutside');
set(gcf,'position',[50,325,1200,400]);

% Optional: to examine the positive definite property of the inertia matrix
n_step=length(t);
theta=sym('theta',[1,par.n_link]);
theta_dot=sym('theta_dot',[1,par.n_link]);
eig_val=zeros(n_step,2);
for i=1:n_step
    M=double(subs(M,[theta,theta_dot],[q(i,1),q(i,2),q(i,3),q(i,4)]));
%     M=double(subs(M,['theta1','theta2','theta_dot1','theta_dot2'],[q(i,1),q(i,2),q(i,3),q(i,4)]));
    eig_val(i,:)=eig(M);
end




